import React from 'react';
import { useNavigate } from 'react-router-dom';
import foodBackground from '../assets/food_background.jpeg';

const Home = () => {

    const navigate = useNavigate();

    const menuClick = (e) => {
        e.preventDefault();
        navigate('menu');
    };

    const cartClick = (e) => {
        e.preventDefault();
        navigate('cart');
    };

    return (
    <div>
        <img 
            alt="restauraunt food" 
            src={foodBackground}/>
    </div>
  );
}

export default Home;
